import React from 'react'
import { useState } from 'react';
import './Body.css';
import Welcome from './Welcome.tsx';
import Overview from './Overview.tsx';
type Props = {
  showModal : boolean,
  children?: React.ReactNode,
}

const [displayHelper, setHelperDisplay] = useState(false);
function Body({showModal, children} : Props) {
  

  function handleHelperDisplay(props: {displayHelper: boolean, setHelperDisplay : any}): void {
    if (displayHelper === false)
      setHelperDisplay(true);
    else
      setHelperDisplay(false);
    console.log(displayHelper);
    

 }
  return (
    <div className="Body">
      <Welcome changeHelperDisplay = {handleHelperDisplay}></Welcome>
      <Overview></Overview>
    </div>
  );
}

export default Body;
